import React, {useState, useEffect} from 'react';

export default function AccordionPanel() {
    const title = 'Accordion Title';
    const description = 'Description';

    return (
        <div className="accordion">
            <div className="title">
                {title}
            </div>
            <div className="description">
                {description}
            </div>
        </div>
    )
}
